import React from 'react';
import { useNavigate } from 'react-router-dom';
import './ReadAnimalPage.css'; // Importa el archivo de estilos

const ReadAnimalPage = () => {
    const navigate = useNavigate();

    const handleBack = () => {
        navigate('/');
    };

    return (
        <div className="read-animal-page">
            <h1>Leer Animales</h1>

            <div style={{ marginBottom: '10px' }}>
                <button style={{ marginRight: '10px' }}>Lista de todos los animales</button>
            </div>

            <div style={{ marginBottom: '10px' }}>
                <button style={{ marginRight: '10px' }}>Buscar Nombre</button>
                <input type="text" placeholder="Ingrese nombre" />
            </div>

            <div style={{ marginBottom: '10px' }}>
                <button style={{ marginRight: '10px' }}>Buscar por ID</button>
                <input type="text" placeholder="Ingrese ID" />
            </div>

            <div style={{ marginBottom: '10px' }}>
                <button style={{ marginRight: '10px' }}>Buscar por Fecha</button>
                <input type="date" />
            </div>

            <div style={{ marginBottom: '10px' }}>
                <button style={{ marginRight: '10px' }}>Buscar por Hábitat</button>
                <input type="text" placeholder="Ingrese hábitat" />
            </div>

            <div style={{ marginBottom: '10px' }}>
                <button style={{ marginRight: '10px' }}>Buscar por Cuidador</button>
                <input type="text" placeholder="Ingrese cuidador" />
            </div>

            <button onClick={handleBack}>Atras</button>
        </div>
    );
};

export default ReadAnimalPage;
